	this.vs = `
	precision highp float;
	attribute vec3 position;
	attribute vec3 normal;
	attribute vec2 texCoord;
	uniform mat4 normMat;
	uniform mat4 viewMat;
	uniform mat4 projMat;
	uniform vec3 sun;
	varying vec3 fNormal;
	varying vec3 fPosition;
	varying vec3 fsun;
	varying vec2 fTexCoord;
	
	void main() {
		fNormal = normalize(mat3(normMat) * normal);
		vec4 pos = viewMat * vec4(position, 1.0);
		fPosition = pos.xyz;
		fTexCoord = texCoord;
		fsun = (normMat * vec4(sun,1.0)).xyz;
		gl_Position = projMat * pos;
	}`;
	
	this.fs = `
		precision highp float;
		uniform vec3 color;
		uniform sampler2D texture;
		varying vec3 fNormal;
		varying vec3 fPosition;
		varying vec3 fsun;
		varying vec2 fTexCoord;
		
		void main() {
			vec3 n = normalize(fNormal);
			vec3 v = normalize(-fPosition);
			vec3 l = normalize(fsun);
			vec3 h = normalize(v+l);
			vec3 ambient = 0. * color;
			vec3 diffuse = 0.1 * vec3(1.0,1.0,1.0)*max(0.0,dot(n,l));
			vec3 spec = 0.2 * vec3(1.0,1.0,1.0)*pow(max(0.0,dot(n,h)), 2.);
			gl_FragColor = texture2D(texture, fTexCoord) + vec4(ambient + diffuse + spec,1.0);
		}`;
	
